import { useDispatch, useSelector } from "react-redux";
import AdminPageWrapper from "./AdminPageWrapper";
import { useNavigate } from "react-router-dom";
import "../App.css";
import { useEffect } from "react";
import { subscribeAllData } from "../store";
import axios from "axios";
function AdminDashboard() {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const data = "aaaa"
  const url = "http://localhost:3000/api/admin/user-data";
  useEffect(() => {
    const { data: res } = axios.put(url, data);

    localStorage.setItem("all-user", JSON.stringify(res.data));
    dispatch(subscribeAllData(res.data));
  },[]);

  const userData = useSelector((state) => state.allData);

  console.log(userData);

  const mappedItems = userData.map((data) => {
    return (
      <tr key={data._id}>
        <td>{data.name}</td>
        <td>
          {data.image ? (
            <img className="image-holder" src={data.image} alt="imagxcvxve" />
          ) : (
            <p>No image</p>
          )}
        </td>
        <td>{data.email}</td>
        <td>
          <button>Edit</button>
        </td>
        <td>
          <button>Delete</button>
        </td>
      </tr>
    );
  });

  return (
    <div>
      <table className="table border table-striped table-bordered">
        <thead>
          <th className="border">Name</th>
          <th className="border">Image</th>
          <th className="border">E-mail</th>
          <th className="border">Edit</th>
          <th className="border">Delete</th>
        </thead>
        <tbody>{mappedItems}</tbody>
      </table>
    </div>
  );
}

export default AdminDashboard;
